/** @jsxImportSource @emotion/react */

import React, { useState } from "react";
import { sideBarStyle } from "../../../styles/components/SideBar";
import { NavLink } from "react-router-dom";
import RouterInfo, { RouterItem } from "../../routes/RouterInfo";

const SideBar: React.FC = (): JSX.Element => {
  // const [isWithNav, setIsWithNav] = useState<boolean>(true);

  const handleNavOnUpdate = (isWithNav: boolean) => {
    console.log(isWithNav);
  };

  return (
    <article css={sideBarStyle}>
      <nav>
        {Object.entries(RouterInfo).map(
          ([key, item]: [string, RouterItem]) =>
            item.isShowNav && (
              <NavLink
                key={item.path}
                to={item.path}
                onUpdate={() => handleNavOnUpdate(item.isWithNav)}
              >
                {item.label}
              </NavLink>
            )
        )}
      </nav>
    </article>
  );
};

export default SideBar;
